import arrow_link from '../svg/arrow_link.svg'


const Btn = ({text}) => {
    return(
        <button>
        <div>
        <span></span>
        </div>
        <span id='span-btn-not-fixed'></span>
        <p>{text}</p>
        <img src={arrow_link}/>
    </button>
    ); 
}; 

export default Btn;
